class recDotDefaultDict(defaultdict):
  __getattr__ = defaultdict.__getitem__
  __setattr__ = defaultdict.__setitem__
  __delattr__ = defaultdict.__delitem__
  def __init__(self, _=None):
    super(recDotDefaultDict, self).__init__(recDotDefaultDict)

def log(*x):
  print(*x, file=sys.stderr)

def relu(x):
  return x * (x > 0)

def shape(v, dim):
  return v.shape[dim]

def ffnn(ffnn_params, inputs, output_size, activation=relu):
  w, b = ffnn_params
  if output_size is None:
    output_size = shape(inputs, -1)

  inputs_rank = len(inputs.shape)
  if inputs_rank == 3:
    batch_size = shape(inputs, 0)
    max_sequence_length = shape(inputs, 1)
    inputs = np.reshape(inputs, [batch_size * max_sequence_length, hidden_size])
    outputs = np.matmul(inputs, w) + b
    outputs = np.reshape(outputs, [batch_size, max_sequence_length, output_size])
  elif inputs_rank < 3:
    outputs = np.matmul(inputs, w) + b
  return activation(outputs)

def softmax(a, axis=-1):
  c = np.max(a, axis=axis)
  exp_a = np.exp(a - c)
  sum_exp_a = np.sum(exp_a, axis=axis)
  y = exp_a / sum_exp_a
  return y

def attention(attn_params, ref_state, cand_state):
  rw, rb, cw, cb = attn_params
  attn_size = shape(rb, -1)
  v1 = ffnn((rw, rb), ref_state, attn_size)
  v2 = ffnn((cw, cb), cand_state, attn_size)
  v1 = np.expand_dims(v1, -2)
  attn_weights = softmax(np.sum(v1*v2, -1), -1)
  return attn_weights

def argmax(_list):
  if not _list:
    return None
  _list = [(i, x) for i, x in enumerate(_list)]
  return max(_list, key=lambda x: x[1])[0]

def argmin(_list):
  if not _list:
    return None
  _list = [(i, x) for i, x in enumerate(_list)]
  return min(_list, key=lambda x: x[1])[0]

def flatten(_list):
  new_list = []
  for l in _list:
    new_list += l
  #map(lambda l: new_list += l, _list)
  return new_list

def parse_item(item_str):
  return tuple([x for x in item_str.split('-') if x and x != NONE])


